import { Chart } from "react-google-charts";
let data = [
  ["Comment", "likes"],
  ["tanuja", 1245],
  ["shrre", 2362],
  ["ritesh", 1522],
  ["manas", 2950],
  ["palak", 1787],
];

let data1={
  "Comment":"Likes",
  "ritesh":"2345",
  "shree":"1232",
  "shjsd":"2345",
  "sdf":"1234",
}
 const options = {
  title: "most liked sensitional comment",
};

const ColumnChart = () => {
  return (
    <Chart
      chartType="ColumnChart"
      data={data}
      options={options}
      width={"50%"}
      height={"400px"}
    />
  )
}
export default ColumnChart;
